import React from 'react';
import './login.css';
class Login extends React.Component
{
	render()
	{
		return <div>
				<div id = "login"> 
					<input type = "text" id = "u"></input>
					<input type = "text" id = "p"></input>
			</div>
		</div>
	}
}

export default Login;
